import React from 'react';
import {
  StyleSheet,
  View,
  Text,
  TextInput,
  TouchableOpacity,
  Image,
} from 'react-native';

// import FormTextInput from '../components/FormTextInput';
// import NewTouchableOpacity from '../components/NewTouchableOpacity';
// import {db} from '../../../firebase';

let filled = false;

let Login2 = ({setLogin2Visible}) => {
  let [email, setEmail] = React.useState('');
  let [username, setUsername] = React.useState('');
  let [name, setName] = React.useState('');

  return (
    <View style={styles.container}>
      <Image style={styles.logo} source={require('../../assets/Logo.png')} />
      <View style={styles.form}>
        <TextInput
          style={styles.textinput}
          value={email}
          onChangeText={email => setEmail(email)}
          placeholder="Email"
        />
        <TextInput
          style={styles.textinput}
          value={username}
          onChangeText={username => setUsername(username)}
          placeholder="Username"
        />
        <TextInput
          style={styles.textinput}
          value={name}
          onchangeText={name => setName(name)}
          placeholder="Name"
        />

        <TouchableOpacity
          style={styles.enterform}
          onPress={() => {
            setLogin2Visible(false);
          }}>
          <Text style={styles.text}>Log in</Text>
        </TouchableOpacity>

        <View style={{alignItems: 'center', marginBottom: 15}}>
          <Text style={{fontSize: 20, color: 'gray'}}> OR </Text>
        </View>
      </View>
    </View>
  );
};
const styles = StyleSheet.create({
  container: {
    backgroundColor: 'white',
    flex: 1,
    alignItems: 'center',
    justifyContent: 'space-between',
  },
  logo: {
    flex: 1,
    width: '100%',
    resizeMode: 'contain',
    alignSelf: 'center',
  },
  form: {
    flex: 1,
    justifyContent: 'center',
    width: '80%',
  },
  enterform: {
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: 'blue', // change it
    marginBottom: 12,
    paddingVertical: 12,
    borderRadius: 4,
    borderWidth: 1,
    borderColor: 'blue',
  },
  text: {
    color: 'white',
    textAlign: 'center',
    height: 20,
  },
  textinput: {
    height: 40,
    borderColor: 'silver',
    borderBottomWidth: 1,
    marginBottom: 20,
  },
});

export default Login2;
